From the webmaster comes the following announcement:

From Webmaster:

&quot;Hey guys. I want to share my thoughts abut Katie's future with Famegirls and why I'm thinking about replacing her with a new model. Katie wants to continue working but will not take things further to the level of content already reached. It makes many members disappointed with her sets since they are the same as when she first started. Starting in the middle of April, I'm going to replace Katie with a new model named Casey. After a month or two, I'll start another vote to see which model you prefer between the two.
And always, I keep looking for new girls.

The new girl Casey has some experience in photo modeling such as clothing, internet, journal magazines, and video advertising for Europe TV. I'm happy to say that she will take off her clothes for the first time for Famegirls.&quot;

I have enclosed in this file a folder with 4 pics available of Casey... Personally I will miss Katie if she goes but as the situation stands it looks like that will be the case....

I wish her well for the future...

Allison.
